import React from 'react'
import ReactDom from 'react-dom';
import { useForm, ErrorMessage } from "react-hook-form";
import { Route, BrowserRouter, Link, useLocation } from "react-router-dom";
import { StateMachineProvider, createStore } from "little-state-machine";
import __RegistrationForm1 from './__RegistrationForm1';
import __RegistrationForm2 from './__RegistrationForm2';
import __Result from './__Result';


createStore({
    yourDetails: {
        firstName: "",
        lastName: "",
        age: ""
    }
})

const __RegistrationForm = () => {

    const location = useLocation();

    return (
        <>
            <nav className="container">
                <ul className="steps">
                    <li className={location.pathname === "/" ? "active" : ""}>
                        <Link to="/">Step 1</Link>
                    </li>
                    
                    <li className={location.pathname === "/__RegistrationForm2" ? "active" : ""}>
                        <Link to="/__registrationForm2">Step 2</Link>
                    </li>
                    <li className={location.pathname === "/__Result" ? "active" : ""}>
                        <Link to="/result">Result</Link>
                    </li>
                </ul>
            </nav>
            <Route exact path="/" component={__RegistrationForm1} />
            <Route path="/__RegistrationForm2" component={__RegistrationForm2} />
            <Route path="/__Result" component={__Result} />
        </>
    )
}

function Abc() {

    return (
      <StateMachineProvider>
        <div>
          <BrowserRouter>
            <__RegistrationForm />
          </BrowserRouter>
        </div>
      </StateMachineProvider>
    );
  }

export default Abc;
